import React, { Component } from "react";
import { Card, Button } from "react-bootstrap";
import { MdEmail, MdClose } from "react-icons/md";
import { GiTrophy } from "react-icons/gi";
import { IoMdClipboard } from "react-icons/io";
import ProfilePic from "../pictures/userprofilepic.jpg";
import "./userProfile.css";
import Divider from "@material-ui/core/Divider";
class UserProfile extends Component {
  render() {
    return (
      <div id="container">
        <Card
          //bg="dark"
          border="warning"
          style={{ width: "44rem", marginLeft: 40 }}
        >
          <Button
            onClick={() => {
              this.props.closeProfil(false);
            }}
          >
            <MdClose size={20} />
          </Button>
          <Card.Header style={{ textAlign: "center" }}> Profile</Card.Header>
          <Card.Body>
            <Card.Title style={{ marginLeft: 230 }}>
              <img id="profilepic" alt="lol" src={ProfilePic} />
            </Card.Title>
            <Card.Text style={{ marginLeft: 70 }}>
              <MdEmail /> Email :&ensp;{" "}
              {this.props.email ? this.props.email : "no data"}
              <Divider />
              <IoMdClipboard /> Score :&ensp;{" "}
              {this.props.score ? this.props.score : "No DATA"}
              <Divider />
              <GiTrophy /> Level :&ensp;
              {this.props.levelRook ? "Rookie" : "No DATA"}
              {this.props.levelStudent ? "Student" : "No DATA"}
              {this.props.levelIntermediate ? "Intermediate" : "No DATA"}
              {this.props.levelExpert ? "Expert" : "No DATA"}
              {this.props.levelMaster ? "Master" : "No DATA"}
              <Divider />
              Last Logged in :&ensp;
              {this.props.time ? this.props.time : "no data"}
              <Divider />
            </Card.Text>
          </Card.Body>
        </Card>
      </div>
    );
  }
}
export default UserProfile;
